import React from 'react'
// import PropTypes from 'prop-types'
import Container from '../Container/Container'
import Dots from '../Dots/Dots'
import styles from './About.module.scss'

function About(props) {
  return (
    <section className={styles.About}>
      {/* Image background */}
      <div className={styles.About__imageBg}></div>
      <Container>
        <div className={styles.About__contentWr}>
          <h2 className={styles.About__title}>Про Origin</h2>

          <div className={styles.About__textWr}>
            <Dots>Origin Digital Agency работает по принципу несдвигаемых дедлайнов, фиксированному бюджету и гибкой функциональности, которому боятся следовать другие студии.</Dots>
            <Dots><span className={'redText'}>Миссия Origin Digital Agency</span> — не просто создавать сайты с красивым дизайном, а создавать продукт с работоспособной системой, которая не развалится после запуска. Для этого мы глубоко изучаем задачу клиента, и только после этого приступаем к разработке полноценного продукта.</Dots>
          </div>
        </div>
      </Container>
    </section>
  )
}

// About.propTypes = {

// }

export default About
